Arahan:
--------------
-Sila tekan butang "Sandaran" ;
-Aktifkan capaian data melalui Wi-Fi atau Rangkaian Mudah Alih dan benarkan semua sambungan untuk aplikasi;
-Pilih corak dan tekan "Koyok";
-Tekan "Lancarkan" dan periksa status lesen (segar semula, jika perlu);
-Jika corak ini tidak membantu, tekan "Pulihkan semula" dan cuba lagi dengan corak yang lain.
 Jika operasi adalah berjaya tekan "Betulkan Pengubahan".

Bantuan:

 - Corak untuk hex asal (panjang>3):
 AA 1F ** 01 4C
 ** - apa-apa bait;

 - Penggantian untuk corak hex (panjang>3):
 EA 2F ** ** **
 ** - jangan mengubah bait;

Kuantiti bait asal dan bait yang diubahsuai mestilah sama;
